import React, { Component } from "react";
import NotePage from "../components/NotePage";
import MyTabPanel from "../components/MyTabPanel";
import data from "../data/data";
import {
  TabContent,
  TabPane,
  Nav,
  NavItem,
  NavLink,
  Card,
  Button,
  CardTitle,
  CardText,
  Row,
  Col,
} from "reactstrap";

class App extends Component {
  constructor() {
    super();
    this.state = {
      currentNoteID: null,
      currentNote: null,
      notes: null,
    };
  }

  render() {
    return (
      <div className="container">
        <MyTabPanel />
        <NotePage />

        <Card body>
          <CardTitle>{data["Learn React"][0].title}</CardTitle>
          <CardText>
            With supporting text below as a natural lead-in to additional
            content.
          </CardText>
          <Button>Go somewhere</Button>
        </Card>
      </div>
    );
  }
}

export default App;
